version: "1"

package:
  id: org.deepin.runtime.dtk
  name: deepin runtime
  kind: runtime
  version: 23.1.0.0
  description: |
    Qt is a cross-platform C++ application framework. Qt's primary feature
    is its rich set of widgets that provide standard GUI functionality.

base: org.deepin.base/23.1.0

build: |
  # 生成包列表
  ./packages.bash > "$PREFIX/packages.list"
  # 跳过qtchooser安装
  echo Package: qtchooser >> "$PREFIX/packages.list"
  # 初始化构建环境
  source init.bash
  # 开始构建
  rm -rf logs && mkdir logs
  bash -e build.bash 2>&1 | tee logs/build.log
  # 设置环境变量
  mkdir -p $PREFIX/etc
  echo "export QT_QPA_PLATFORM_PLUGIN_PATH=$PREFIX/lib/$TRIPLET/qt5/plugins/platforms" >> "$PREFIX/etc/profile"
  echo "export QT_PLUGIN_PATH=$PREFIX/lib/$TRIPLET/qt5/plugins" >> "$PREFIX/etc/profile"

